          <Table.Cell>
            <Form>
              <Form.Field inline>
                <label style={{ minWidth: "5em" }}>이름</label>
                <Input id="Rname" style={{ minWidth: "15em" }} />
              </Form.Field>
              <Form.Group inline>
                <Form.Field>
                  <label style={{ minWidth: "5em" }}>연락처</label>
                  <Input id="Rp1" style={{ maxWidth: "5em" }} />
                </Form.Field>
                <Form.Field>
                  <label>-</label>
                  <Input id="Rp2" style={{ maxWidth: "5em" }} />
                </Form.Field>
                <Form.Field>
                  <label>-</label>
                  <Input id="Rp3" style={{ maxWidth: "5em" }} />
                </Form.Field>
              </Form.Group>
            </Form>
          </Table.Cell>
        </Table.Row>
        <Table.Row>
          <Table.Cell>
            <Form>
              <Form.Group inline>
                <Form.Field>
                  <label style={{ minWidth: "5em" }}>주소</label>
                  <Input
                    id="Rzip"
                    value={state.Rpost}
                    style={{ maxWidth: "8em" }}
                  />
                </Form.Field>
                <Button onClick={receiverJusoPopup}>Submit</Button>
              </Form.Group>
              <Form.Field inline>
                <label style={{ minWidth: "5em" }}></label>
                <Input
                  id="Raddr1"
                  value={state.Raddr1}
                  style={{ minWidth: "15em" }}
                />
              </Form.Field>
              <Form.Field inline>
                <label style={{ minWidth: "5em" }}></label>
                <Input id="Raddr2" style={{ minWidth: "15em" }} />
              </Form.Field>
            </Form>
          </Table.Cell>
        </Table.Row>
      </Table.Body>
      <Table.Header>
        <Table.Row>
          <Table.HeaderCell colSpan="2">상품 정보</Table.HeaderCell>
        </Table.Row>
      </Table.Header>
      <Table.Body>
        <Table.Row>
